  _parseLine:function(v){
    let s="",ps=[],b,k,kk,_endExpress=[],_comment,_inDo,_oneLine=[];
    v=v.trim()

    for(let i=0;i<v.length;i++){
      let c=v[i]

      if(_comment=="/"+"/"){
        if(c=="\n"){
          _comment=0
        }else{
          continue
        }
      }else if(_comment=="/"+"*"){
        if(c=="/"&&v[i-1]=="*"){
          _comment=0
        }
        continue
      }
      if(!s&&c.match(/\s/)){
        continue
      }else if(c=="\\"){
        b=!b
      }else if(b){
        b=0
      }else if(kk){
        if(kk==c){
          kk=0
        }
      }else if("`'\"".includes(c)){
        kk=c
      }else if(k=="/"&&c=="/"){
        k=0
      }else if(!k&&c=="/"&&s.trim().match(/[\(\[\=\?\:]$/)){
        k="/"
      }else if(c==" "&&("+-*/([{%!\?\:".includes(v[i+1])||s.match(/([\s\(\{\[\+\-\*\?\:\/\%\&\|\^\~])$/))){
        continue
      }else if((c=="/"||c=="*")&&s.match(/[^\\]\/$/)){
        _comment="/"+c
        s=s.replace(/[\/]$/,"")
        continue
      }else if(k){
        if(k.r==c){
          if(k.n){
            k.n--
          }else{
            if(_endExpress[0]&&s.includes(_endExpress[0])&&s.substring(_endExpress[0].length).trim()[0]!="{"){
            }else if(k.l=="{"){
              if(s.match(/^(for|if|while|switch|function|else|do|try)[\s\(\{]/)){
                s+=c
                if(!s.match(/^(do|try)/)){
                  _init()
                }
                k=0
                continue
              }
            }else if(k.l=="("&&s.match(/^(if|for|while|switch|function|else if)[\s|\(]/)){
              _endExpress.unshift(s+")")
              let vv=v.substring(i+1).trim();
              if(vv.match(/^(for|if|while|do|try)(\s|\{|\(|$)/)){
                v=vv
                i=-1
                _oneLine.push(_endExpress[0])
                _endExpress=[]
                s=""
                continue
              }
            }
            k=0
          }
        }else if(k.l==c){
          k.n++
        }else if(c.match(/\s/)){
          let vr=v.substring(i+1).trim(),
              vl=v.substring(0,i)
          if(_uselessSpace(vr,vl,c)){
            continue
          }
        }
      }else if(c=="\n"){
        if((_endExpress[0]||"").replace(/ /g,"")==(s||"").replace(/ /g,"")){
          continue
        }
        s=s.trim()
        if(s.match(/^do([\s\{]|$)/)&&!_inDo){
          if(!s.match(/^do\s*\{.+while.+\)/s)){
            s+=c
            _inDo=1
          }else{
            _init()
          }
          continue
        }


        let vr=v.substring(i+1).trim(),
            vl=v.substring(0,i)
        if(_uselessSpace(vr,vl,c)){
          continue
        }
        if(_inDo==1){
          if(!vr.match(/^while(\s|\()/)){
            _inDo=0
            _init()
          }else{
            s+=c
          }
          continue
        }
        if(vl.endsWith("}")&&vr.match(/^(catch|while)(\s|\()/)){
          continue
        }else if(s.trim()=="else"){
          s="else "
          continue
        }
        _init()
        continue
      }else if(c==";"){
        let vr=v.substring(i+1).trim()
        if((!_inDo||!vr.match(/^while(\s|\()/))&&_endExpress[0]!=s){
          ps.push(s.trim())
          s=""
          _init()
          continue
        }
      }else if(_bzEval.bd[c]){
        s=s.trim()
        k={l:c,r:_bzEval.bd[c],n:0}
      }
      s+=c
    }
    _init()
    return ps

    function _uselessSpace(vr,vl,c){
      if(vl.match(/([^-]-|[^+]\+|[^\/]\/|[\*=~!&\|\^%><?:,;\.\(\[\{])$/)||vr.match(/^(-[^-]|\!\=|\+[^+]|\/[^\/\*]|[\*%\^&|=><?:,;\.\(\)\[\]\}])/)||vl.match(/([\+][\+][\+]|---)$/)){
        return 1
      }else if(vr[0]=="{"){
        return c!="\n"
      }
    }

    function _init(){
      s=s.trim()
      if(_oneLine.length){
        s=_oneLine.join(" ")+s
        _oneLine=[]
      }
      if(s){
        ps.push(s)
        s=""
      }
      _endExpress.shift()
      _inDo=0
    }
  },
