  _getBoxViewDef:function(d){
    let v={
      _if:d._if,
      _tag:"div",
      _data:d._data,
      _attr:{
        class:d._class,
        style:d._style
      },
      _items:[]
    }
    if(d._title){
      v._items.push({
        _tag:"div",
        _attr:{
          _tag:"bz-header"
        },
        _text:d._title
      })
    }
    d._items&&d._items.forEach(x=>{
      _addItem(x,v)
    })
    return v
    
    function _addItem(x,v){
      if(x._type=="box"){
        v._items.push(_stdComponent._getBoxViewDef(x))
      }else if(x._type=="_rowbox"){
        let _row={
          _if:x._if,
          _update:x._update,
          _tag:"div",
          _attr:{
            style:"display:flex;"
          },
          _items:[]
        }
        v._items.push(_row)
        x._items.forEach(x=>{
          _addItem(x,_row)
          let o=_row._items.pop()
          o._attr.style=o._attr.style||"flex:1;"
          _row._items.push(o)
        })
      }else if(x._src){
        v._items.push(x._src)
      }else{
        v._items.push(_stdComponent._getInputViewDef(x))
      }
    }
  },
